import React from "react";
import styled from "styled-components";

const SidebarContainer = styled.div`
  width: 250px;
  background-color: #1c1e22;
  color: white;
  padding: 20px;
`;

const Title = styled.h2`
  font-size: 20px;
  margin-bottom: 20px;
`;

const List = styled.ul`
  list-style-type: none;
  padding: 0;
`;

const ListItem = styled.li`
  margin-bottom: 10px;
`;

const Sidebar = () => {
  return (
    <SidebarContainer>
      <Title>이슈 캘린더</Title>
      <List>
        <ListItem>06월 11일 화요일</ListItem>
        <ListItem>06월 12일 수요일</ListItem>
        <ListItem>06월 15일 토요일</ListItem>
        <ListItem>06월 17일 월요일</ListItem>
      </List>
    </SidebarContainer>
  );
};

export default Sidebar;
